import { useState } from "react";
import Button from "./button.js"

function App() {
  const [count, setCount] = useState(0);
  function handleClick() {
    setCount(count + 1);
  }

  return (
    <div>
      <Button count = {count} handleClick={handleClick} />
      <Button count = {count} handleClick={handleClick}/>
    </div>
  );
}
export default App;
